import React from 'react';

import { Link } from 'react-router-dom';

let forumCard = {
    maxWidth: "100%",
    backgroundColor:"#eee",
}
let questiontext = {
    fontWeight: '500'
}

function ChatCard(props) {
    return (
        <div style={forumCard}>
            <Link to={"/forum/joinchat/s" + props.chat.id}>
                <p style={questiontext}>{props.chat.question}</p>
                <p>{props.chat.name}</p>
                <p>{props.chat.state}</p>

                <p>{props.chat.date}</p>
            </Link>
        </div>
    )
}

export default ChatCard;
